package fixtures

import (
	"github.com/go-faker/faker/v4"
	"go-api/internal/storage/postgres"
	"gorm.io/gorm"
	"math/rand/v2"
)

func PopulateDrops(db *gorm.DB) error {

	types := []string{"youtube", "twitch", "films", "spotify"}
	var dropNotifications []postgres.DropNotification
	for i := range 365 {
		iuint := uint64(uint(i))
		s := rand.NewPCG(iuint, iuint*47329)
		r := rand.New(s)
		dropNotifications = append(dropNotifications, postgres.DropNotification{
			Type: types[r.IntN(len(types))],
		})
		db.Create(&dropNotifications[i])
	}

	var activeUsers []postgres.User
	db.Where("status = ?", 1).Find(&activeUsers)
	statuses := []int{-1, 1}
	images := []string{"data:image/png;base64,", "data:image/png;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "https://static1.squarespace.com/static/656f4e4dababbd7c042c4946/657236350931ee4538eea52c/65baf15103d8ad2826032a8a/1707422532886/how-to-stop-being-a-people-pleaser-1_1.jpg?format=1500w", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,", "data:image/jpeg;base64,"}

	for i := range dropNotifications {
		iuint := uint64(uint(i))
		for j := range activeUsers {
			s := rand.NewPCG(iuint, iuint*47329*uint64(j))
			r := rand.New(s)
			isPinned := r.IntN(3) == 0
			status := statuses[r.IntN(len(statuses))]
			picture := images[r.IntN(len(images))]
			db.Create(&postgres.Drop{
				Type:               dropNotifications[i].Type,
				Content:            "content",
				Description:        faker.Sentence(),
				CreatedById:        activeUsers[j].ID,
				Status:             uint(status),
				IsPinned:           isPinned,
				DropNotificationID: dropNotifications[i].ID,
				Lat:                faker.Latitude(),
				Lng:                faker.Longitude(),
				PicturePath:        picture,
			})
		}
	}

	return nil
}
